  \"Nesting success of geese in the coastal tundra region of the Yukon-Kuskokwim Delta:
  1987 field report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:02:53.865114\",\n\t\"name\": \"nesting-success-of-geese-in-the-coastal-tundra-region-of-the-yukon-kuskokwim-delta-1987-fi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Nesting success through late-incubation
  for cackling Canada, emperor, white-fronted geese and black brant was exceptionally
  high in 1987 with all species averaging above 90% success. Clutch sizes were average.
  Chronology of arrival, nest initiation and hatch was normal or perhaps 1 or 2 days
  earlier than the long term average. Reduction of arctic fox by trapping seemed to
  ensure high nest success at three of four study sites. Analysis of data from 85
  random plots searched along with 45 other plots provided estimates that 22,000 cackling
  Canada, 21,000 emperor, and 9,000 white-fronted goose nests were present on the
  1,800 square miles of coastal habitat that contains about 90% of the total geese
  of the YK Delta.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
